import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useHistory } from 'react-router-dom';



const Step2 = () => {
  const history = useHistory();
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    // Fetch data from Step1
    const step2Data = JSON.parse(localStorage.getItem('step2Data'));
    if (step2Data) {
      const { pickupDateTime, returnDateTime, selectedLocation, customAddress } = step2Data;
      // Make API call to get available vehicles based on the provided data
      const fetchData = async () => {
        try {
          // Make your API call here with the provided data
          // Example API call:
          const response = await axios.get(`https://your-api.com/vehicles?pickupDateTime=${pickupDateTime}&returnDateTime=${returnDateTime}&selectedLocation=${selectedLocation}&customAddress=${customAddress}`);
          setVehicles(response.data);
        } catch (error) {
          console.error('Error fetching data:', error);
          setError('Failed to fetch data');
        } finally {
          setLoading(false);
        }
      };

    }
  }, []);

  return (
    <div>
      {loading && <p>Loading...</p>}
      {!loading && error && <p>{error}</p>}
      {!loading && !error && (
        <>
          {/* Render vehicles catalog here */}
          {vehicles.map(vehicle => (
            <div key={vehicle.id}>
              <h3>{vehicle.name}</h3>
              <p>{vehicle.description}</p>
              {/* Render vehicle photo and features */}
            </div>
          ))}
        </>
      )}
    </div>
  );
};

export default Step2;
